import React from 'react';
import { Col, Avatar } from 'antd';


const FollowersCard = (props) => {


    return (

        <section>

            <div className='figure'>
                <Col span={8}>

                <Avatar
                width={110}
                height={120}
                src={props.img}/> 

                <a href={props.html_url}>
                    <h4>{props.login}</h4>
                </a>

                </Col>

            </div>

        </section>

    );
}

export default FollowersCard;
